import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

// Replace the usage of <Switch> with <Routes>
function AppRouter() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<MainPage />} />
                <Route path="/product/:productId" element={<ProductDetailPage />} />
            </Routes>
        </Router>
    );
}
